import React from 'react';
import { NavLink } from 'react-router-dom';


export default function NavBar() {
  return (
    <div>
        <nav class="navbar navbar-dark bg-dark">
            <NavLink to="/articles" activeClassName="selected" className="btn btn-outline-primary btn-lg btn-block">Articles</NavLink>
            <NavLink to="/" activeClassName="selected" className="">Home</NavLink>
            <NavLink to="/articles/new" activeClassName="selected" className="">Create</NavLink>
            <NavLink to="/articles">Articles</NavLink>
        </nav>
    </div>
  )
}
